insert  into `wp_options`(`option_id`,`option_name`,`option_value`,`autoload`) values (110,'widget_custom_html','a:2:{i:2;a:2:{s:5:\"title\";s:0:\"\";s:7:\"content\";s:1978:\"<div class=\"section-title\">\r\n	<h2 class=\"widget-title\">About Us</h2>\r\n	<div class=\"seperator\">\r\n		<span><i class=\"fa fa-laptop\"></i></span>\r\n	</div>\r\n	<p>To be one of the best agriculture products exporters of India and recognized as trusted partner with our \r\n	clients.</p>\r\n	<div class=\"business_point_widget_services\">\r\n		<div class=\"container\">\r\n			<div class=\"services-list bp-services\">\r\n				<div class=\"inner-wrapper\">\r\n					<div class=\"services-item about_us\">\r\n						<div class=\"service-icon\"><i class=\"fa fa-globe\"></i></div>\r\n						<p>Transexim is situated at world’s fastest growing city Surat with best quality farming products. Company established in order to provide best farming product of India to worldwide.  With a 1600km long costal line, Gujarat is able to produce so many agriculture product and supply to world.</p>\r\n					</div>\r\n					<div class=\"services-item about_us\">\r\n						<div class=\"service-icon\"><i class=\"fa fa-bookmark\"></i></div>\r\n						<p>We see this company-wide commitment to innovation as essential to build competitive advantage, enhance and leverage the strength of our brands and consistently deliver exceptional and relevant value to customers.</p>\r\n						<p>Across all our businesses, we support a culture in which business success is driven by innovation – and innovation is driven a highly qualified and highly motivated workforce.</p>\r\n					</div>\r\n					<div class=\"services-item about_us\">\r\n						<div class=\"service-icon\"><i class=\"fa fa-podcast\"></i></div>\r\n						<p>We procure these from certified vendors to ensure wholesomeness of the product. The offered product range is available in standard as well as customized specifications. Our ability to deliver large volumes within a stipulated time schedule has aided us in developing strong business alliances and relationships with a number of reputed vendors across the domestic and international market.</p>\r\n					</div>\r\n				</div>\r\n			</div>\r\n		</div>	\r\n	</div>\r\n</div>\";}s:12:\"_multiwidget\";i:1;}','yes');
